import React from 'react';
import { Tree as D3Tree } from 'react-d3-tree';
import data from './cyclonedex.json';

const Tree = () => {
  return (
    <div style={{ width: '100%', height: '600px' }}>
      <D3Tree data={data} />
    </div>
  );
};

export default Tree;
